@charset "UTF-8";

html {
    font-size: 30px;
}

header {
    padding: 25px;
    height: 140px;
    section:first-child {
        section {
            label::after {
                background-image: url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 10 24 14" style="fill: rgba(0, 0, 0, 1);"><path d="M16.939 7.939 12 12.879l-4.939-4.94-2.122 2.122L12 17.121l7.061-7.06z"></path></svg>');
                height: 16px;
            }
        }
    }
}

main {
    gap: 4vh;
    article {
        gap: 5vh;
        &.seventhArticle {
            & > section {
                height: 800px;
            }
        }
    }
}

footer {
    gap: 40px;
    form {
        section {
            input[type=submit] {
                width: 110px;
            }
        }
    }
}
